import { createTheme } from "@mui/material/styles";


//Theme Variable wird erzeugt 

export const theme = createTheme({
    palette: {  // Palette wird creiert 
      primary: {
        
        main: 'purple[500]',
        
      },
      secondary: {
      
        main: 'purple[500]',
    
      },
      warning: {
          dark:'yellow'
      },
    },
  });
